document.addEventListener('turbo:load', loadJobApplicationData);

function loadJobApplicationData() {
  if (!$('#indexJobApplicationData').length) {
    return;
  }

  $('#filterStatus').select2(); // $('.table-responsive').removeClass('table-responsive');

  $('#jobStageId').select2({
    width: '100%',
    dropdownParent: $('#changeJobStageModal')
  });
  var changeJobStage = $('#changeJobStage').val();
  listenHiddenBsModal('#changeJobStageModal', function () {
    $('#jobStageId').val('').trigger('change');
  });
  listenClick('.change-job-stage', function () {
    var jobApplicationId = $(this).data('id');
    $.ajax({
      url: route('stage-check', jobApplicationId),
      type: 'GET',
      success: function success(result) {
        var data = result.data;
        var current_stage = '';

        if (data.current_stage != null) {
          var jobStages = data.job_stages;
          $.each(jobStages, function (key, val) {
            if (val == data.job_stages[data.current_stage]) {
              current_stage = key;
              return true;
            }
          });
        } else {
          current_stage = Object.keys(data.job_stages)[0];
        }

        var nextStage = parseInt(current_stage) + parseInt(1);
        var jobStageAttr = $('#jobStageId');
        jobStageAttr.empty();
        jobStageAttr.append("<option value=\"\">".concat(Lang.get('messages.common.select_job_stage'), "</option>"));
        var stageIndex = Object.keys(data.job_stages)[0];
        $.each(data.job_stages, function (key, val) {
          var disabled = data.current_stage_cleared == true && nextStage != stageIndex || data.current_stage_cleared == false && current_stage != stageIndex ? 'disabled' : '';
          jobStageAttr.append("<option value=\"".concat(key, "\" ").concat(disabled, ">").concat(val, "</option>"));
          stageIndex++;
        }); //selection and show modal

        $('#jobApplicationId').val(jobApplicationId);
        jobStageAttr.val(current_stage).trigger('change');
        $('#changeJobStageModal').appendTo('body').modal('show');
      }
    });
  });
}

