var timePickerFunction = function timePickerFunction(selector) {
  $(document.getElementById(selector)).flatpickr({
    enableTime: true,
    noCalendar: true,
    dateFormat: "H:i",
    time_24hr: true,
    "locale": getLoggedInUserLang,
    minuteIncrement: 1 // defaultHour:0

  });
};

var dateTimePickerFunction = function dateTimePickerFunction(selector) {
  $(document.getElementById(selector)).flatpickr({
    format: 'DD-MM-YYYY',
    useCurrent: true,
    sideBySide: true,
    "locale": getLoggedInUserLang,
    minDate: moment(new Date()).format('YYYY-MM-DD'),
    defaultDate: moment(new Date()).format('YYYY-MM-DD')
  });
};

